package com.frysning.springdnd.spell_level;import com.fasterxml.jackson.annotation.JsonProperty;import javax.persistence.*;@Entity@Table(name = "spell_level")public class SpellLevel {	@JsonProperty(index = 1)	private @Id	@GeneratedValue(strategy = GenerationType.IDENTITY) Long id;	@JsonProperty(index = 2)	private String name;	private int level;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public int getLevel() {		return level;	}	public void setLevel(int level) {		this.level = level;	}}